INSERT INTO `diafan_clauses` VALUES ('1','Тест статья','1','0','monthly','0','1446325200','0','0','1','7','','','','','Конкурс можно проводить тогда, когда у вас есть достаточно места. Набираются две команды по пять &ndash; семь человек. Каждой команде выдают семейные трусы большого размера, чтобы было удобнее снимать и надевать, и шапочку. У финиша встают либо виновника торжества (юбиляр и его супруга), либо выбранные участники. Они держат в руках веники. Задача команд &ndash; игрок надевает трусы и шапочку, бежит к финишу. Там получает пар &ndash; троку ударов веником и возвращается обратно. Снимает банные принадлежности и передает следующему игроку. Тот проделывает то же самое. Выигрывает не та команда, которая быстрее закончит париться, а та, на чьем венике останется как можно меньше листочков.','0','<div class=\"context\">\r\n<p>Конкурс можно проводить тогда, когда у вас есть достаточно места. Набираются две команды по пять &ndash; семь человек. Каждой команде выдают семейные трусы большого размера, чтобы было удобнее снимать и надевать, и шапочку. У финиша встают либо виновника торжества (юбиляр и его супруга), либо выбранные участники. Они держат в руках веники. Задача команд &ndash; игрок надевает трусы и шапочку, бежит к финишу. Там получает пар &ndash; троку ударов веником и возвращается обратно. Снимает банные принадлежности и передает следующему игроку. Тот проделывает то же самое. Выигрывает не та команда, которая быстрее закончит париться, а та, на чьем венике останется как можно меньше листочков.</p>\r\n<p>Конкурс можно проводить тогда, когда у вас есть достаточно места. Набираются две команды по пять &ndash; семь человек. Каждой команде выдают семейные трусы большого размера, чтобы было удобнее снимать и надевать, и шапочку. У финиша встают либо виновника торжества (юбиляр и его супруга), либо выбранные участники. Они держат в руках веники. Задача команд &ndash; игрок надевает трусы и шапочку, бежит к финишу. Там получает пар &ndash; троку ударов вен